import axios from 'axios';
import './App.css';
import React, { useState, useEffect } from 'react';


function App() {
  const [orgs, setOrg] = userState([]);

  useEffect(() => {
    axios.get('localhost:8000/api/orgs')
    .then(response => {
      setOrg(response.data);
    })
    .catch(error => {
      console.log(error);
    });
  }, [])

  return (
    <div>
      {orgs.map( org => (
        <div key={org.id}>
          <h2>{org.title}</h2>
          <img src={org.logo}></img>
          <p>Vision: {org.vision}</p>
          <p>Mission: {org.mission}</p>
          <p>Founed: {org.founded}</p>
          <p>Email: {org.email}</p>
        </div>
      ))}
    </div>
  );
}

export default App;
